"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.default=void 0;var e=require("hyperapp"),r=i(require("../scene/scene.scss")),t=i(require("./intro-text.scss"));function i(e){return e&&e.__esModule?e:{default:e}}var n=function(){return(0,e.h)("div",{class:t.default.introText,key:"introTextComponent"},(0,e.h)("div",{class:r.default.p},"Pinzgau, Februar 2019, mitten in der Skisaison. Plötzlich fällt der Strom aus – nicht nur in der Region, sondern in ganz Österreich und in allen Nachbarländern. Das folgende Feature basiert auf der privaten Fallstudie „Blackout-Szenarios im Salzburger Pinzgau”, die Bundesheeroffizier Gottfried Pausch im Jahr 2016 skizzierte."))};exports.default=n;
