"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.default=void 0;var e=[{headline:"Tag 1",time:"15:00",weather:{icon:"cloudy",text:"2°C"},location:"Skigebiet Gletscher Kitzsteinhorn",text:"<p>Es ist Samstag, der 9. Februar 2019. Bei strahlendem Sonnenschein verbringen um die 9.500 Menschen ihre Freizeit am Gletscher. Um 15 Uhr bleiben plötzlich die Lifte im gesamten Skigebiet stehen. Zehn Meter über der Schneedecke ist selbstständiges Aussteigen unmöglich. Schon nach wenigen Minuten beginnen die Menschen auf dem Sessellift zu frieren. Die Nachrichtendienste am Handy informieren, dass es einen Blackout, einen großflächigen Stromausfall gibt. Für wie lange oder warum, weiß noch niemand.</p>",footer:"weiter scrollen"},{headline:"Tag 1",time:"17:00",weather:{icon:"snow",text:"4°C"},location:"Büro des Bürgermeisters von Kaprun",text:"<p>Heizungen, Computer und Festnetztelefone funktionieren nicht, der Mobilfunk wird in Kürze ausfallen. Oben am Gletscher befinden sich rund 5.000 Personen in den Hütten, 4.500 weitere halten sich draußen auf. Der einzige verfügbare Notarzthubschrauber fliegt geschwächte Skifahrer ins Tal. Der Bürgermeister beantragt beim Militärkommando Salzburg zusätzliche Hubschrauber. Die zwei, die ihm bewilligt werden, können mit Decken und warmen Getränken in einer Stunde oben am Gletscher sein.</p>",footer:""},{headline:"Tag 1",time:"19:00",weather:{icon:"snow",text:"-7°C"},location:"An einer Kreuzung an der Bundesstraße",text:"<p>Jegliche Straßenbeleuchtung und Ampeln sind vor vier Stunden ausgefallen. Die Straßen sind glatt, es kommt zu ersten Unfällen. Einige Insassen haben leichte Verletzungen. Aufgrund der vielen Einsätze sind die Rettungskräfte schon bald überlastet. Es bilden sich Staus in beide Richtungen, die Motoren der Autos laufen, es ist klirrend kalt. Vereinzelte Wagen stehen mit leerem Tank verlassen am Straßenrand. An den Tankstellen bilden sich lange Schlangen, die – strombetriebenen – Pumpen an den Zapfsäulen funktionieren nicht.</p>",footer:""},{headline:"Tag 2",time:"9:00",weather:{icon:"snow",text:"-2°C"},location:"vor dem Supermarkt, Neukirchen am Großvenediger",text:"<p>Viele Supermärkte bleiben geschlossen. Licht, Registrierkassen und Kühlvitrinen funktionieren nicht. Ein Teil des Personals ist nicht zur Arbeit erschienen. Geldautomaten und Kassen sind außer Betrieb, nur Hofläden und Bauern verkaufen ihre Produkte. Viele geben heute ihr letztes Bargeld aus.</p>",footer:""},{headline:"Tag 2",time:"10:15",weather:{icon:"clouds",text:"5°C"},location:"Bezirkshauptmannschaft Zell am See",text:"<p>Das gesamte Bundesland wird zum Katastrophengebiet erklärt. Etwa 40 Menschen sind in der Nacht am Gletscher auf dem Weg ins Tal erfroren. Den Speicherkraftwerken Kaprun gelingt es, Strom zu erzeugen, allerdings nur für zwei Stunden. Die Seilbahnen können so die Menschen am Gletscher evakuieren. Durch Kerzen, Kochen mit Gaskochern und Heizen mit Holz kommt es vermehrt zu Bränden und Brandverletzungen.</p>",footer:""},{headline:"Tag 2",time:"18:00",weather:{icon:"clouds",text:"3°C"},location:"Bauernhof in Leogang",text:"<p>Die Milchkühe können ohne Melkmaschine nicht mehr gemolken werden. Sie haben volle Euter und große Schmerzen, einige müssen bereits notgeschlachtet werden. Der Bauer holt mit dem Güllefass 1.000 Liter zum Tränken der Tiere aus der nahegelegenen Ache. Der benachbarte Landwirt hält Geflügel, seine 10.000 Hühner sind durch den Ausfall der Lüftung bereits verendet.</p>",footer:""},{headline:"Tag 3",time:"11:30",weather:{icon:"clouds",text:"13°C"},location:"Ambulanz des Krankenhaus Mittersill",text:"<p>Seit dem Blackout versorgen Notstromaggregate das Krankenhaus, der dafür notwendige Diesel reicht nur noch bis zum nächsten Tag. Viele Medikamente sind bereits aufgebraucht. Operationen können nicht mehr durchgeführt werden, Ärzte und Pflegepersonal sind körperlich und psychisch an ihren Grenzen. Vor dem Krankenhaus sind Soldaten abgestellt, um den Andrang von Kranken und Verletzten zu regulieren. Bereits am nächsten Tag können keine Patienten mehr aufgenommen werden. Neu erkrankte Personen werden dann in den nächstgelegenen Schulen untergebracht.</p>",footer:""},{headline:"Tag 3",time:"19:00",weather:{icon:"clouds",text:"7°C"},location:"Einfamilienhaus, Bruck an der Glocknerstraße",text:"<p>Es gibt weder Heizung noch Kochgelegenheit, die Lebensmittelreserven im Haus werden eingeteilt. Die Regale und Lager der Supermärkte im Ort sind leer. Polizisten müssen vor dem Einkaufszentrum und der Bank im Ort bereits für Ordnung sorgen.</p><p>Die ersten Familien aus der Stadt Salzburg treffen ein. Wegen Tumulten und Schlägereien auf den Straßen, Einbrüchen und vereinzelter Schusswechsel flüchten viele aus der Stadt. Viele Ankommende werden in den geschlossenen Schulen und Kindergärten untergebracht.</p>",footer:""},{headline:"Tag 4",time:"5:30",weather:{icon:"clouds",text:"-5°C"},location:"Zell am See",text:"<p>Während Einsatzkräfte und viele freiwillige Helfer damit beschäftigt sind, die Versorgung der Bevölkerung einigermaßen sicherzustellen, nützen manche die chaotische Lage aus und plündern Geschäfte und Lager. In den Polizeiinspektionen kommt es wegen Erschöpfung zu hohen Personalausfällen, die Polizei ist nicht mehr in der Lage, alle Delikte zu verfolgen.</p>",footer:""},{headline:"Tag 5",time:"10:30",weather:{icon:"clouds",text:"9°C"},location:"Krisenstab",text:"<p>In den vergangenen vier Tagen sind in der Region über hundert Menschen in Folge des Blackouts gestorben. Im Pinzgau liegen viele Wasserreservoirs höher als die Ortschaften, wäre das nicht so, wäre die Lage aufgrund schlechter Wasserversorgung deutlich kritischer. Alleinstehende ältere Menschen haben es besonders schwer. Wer keine helfenden Bekannten hat, leidet mittlerweile an Hunger. Die Abwasserentsorgung hat einen sehr kritischen Zustand erreicht, weil die Kläranlagen nicht funktionieren. Aufgrund schlechter Hygiene und verunreinigten Wassers gibt es eine sprunghafte Zunahme von Erkrankungen. In den Apotheken sind viele Medikamente nicht mehr erhältlich.</p>",footer:""},{headline:"Tag 5",time:"17:00",weather:{icon:"clouds",text:"2°C"},location:"Kraftwerk",text:"<p>Dem Kraftwerke-Verbund gelingt es, einzelne „Strominseln“ zu schaffen. Bis wieder in allen Haushalten und Betrieben eine stabile Stromversorgung verfügbar ist, dauert es in etlichen Gemeinden jedoch noch weitere Tage.</p>",footer:""},{headline:"Tag 5",time:"17:15",weather:{icon:"clouds",text:"7°C"},location:"Einfamilienhaus",text:"<p>In den Haushalten gehen die Lichter und Geräte wieder an. TV und Radio informieren über die letzten Tage: Allein im Pinzgau hat es hunderte Tote gegeben. Der wirtschaftliche Schaden für Österreich wird auf 15 Milliarden Euro geschätzt. Die Wiederherstellung der beeinträchtigten Infrastruktur wird bis zu einem halben Jahr dauern. ••</p>",footer:""}];exports.default=e;
